CREATE MATERIALIZED VIEW tensorzero.JsonInferenceByEpisodeIdView TO tensorzero.InferenceByEpisodeId\n(\n    `episode_id_uint` UInt128,\n    `id_uint` UInt128,\n    `function_name` LowCardinality(String),\n    `variant_name` LowCardinality(String),\n    `function_type` String\n)\nAS SELECT\n    toUInt128(episode_id) AS episode_id_uint,\n    toUInt128(id) AS id_uint,\n    function_name,\n    variant_name,\n    \'json\' AS function_type\nFROM tensorzero.JsonInference;
